**Điều 5. Khen thưởng học kỳ, năm học**

1. Điều kiện khen thưởng: Việc xét khen thưởng được thực hiện vào cuối

mỗi học kỳ, năm học và áp dụng chung cho toàn thể SV nếu SV đáp ứng đủ

các điều kiện sau:

a) Có đăng ký học phần trong học kỳ xét khen thưởng;

b) Có xếp loại rèn luyện của học kỳ trước đó từ loại Khá trở lên;

c) Không nợ học phí;

d) Không vi phạm các Quy chế, Quy định của Nhà trường; không bị kỷ

luật trong học kỳ xét khen thưởng;

e) Không có học phần nào có điểm dưới 5.0 trong học kỳ xét khen

thưởng.

2. Tiêu chuẩn xét khen thưởng:

a) Tập thể SV hoặc cá nhân SV đoạt giải trong hoạt động học thuật như

sau:

**-** Giải nhất các cuộc thi học thuật cấp Khoa/Trường;

**-** Giải nhất, nhì, ba và khuyến khích các cuộc thi học thuật cấp

ĐHQG, cấp thành, quốc gia, quốc tế.

b) Tập thể SV hoặc cá nhân SV đạt thành tích sau:

**-** Có bài báo đăng trên các tạp chí/hội nghị khoa học trong và ngoài

nước;
